import React from "react";
import './Main.css';

const Main = () => {
    <React.Fragment>
        <div class="row ">
            <div class="col-lg-12 col-md-12 col-sm-12 col-xs-12 home-text ">
                <h3 class="home_title ">Hi, I'm <span>Vani Majjari</span></h3>
                <span class="home_desc ">Front-end developer</span>
                <span class="home_desc "></span>
                <br/>based in the beautiful city of <span class="city ">Melbourne</span>, Florida.<p/>
            </div>
        </div>
    </React.Fragment>
};

export default Main;
